    <p>Hi Nanna ( transl. Hi Dad) is a 2023 Indian Telugu-language romantic drama film directed by Shouryuv, in his directoral debut, and produced by Vyra Entertainments. The film stars Mrunal Thakur, Nani and Kiara Khanna in lead roles. Murthy K. S.</p>
